    $(document).ready(function () {
        $(""#btnKayit"").click(function () {
            var vm = {
                UserMail: $(""#Mail"").val(),
                password: $(""#Password"").val()

            };
            var jss = JSON.stringify(vm);
            $.ajax({
                url: ""http://localhost:25876/api/UserLogin/UserKayit"",
                data: jss,
                type: ""POST"",
                contentType: ""application/json"",
